import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <header>
      <h1>NewsPortal</h1>
      <nav>
        <Link to="/">Home</Link>
        <Link to="/category/sports">Sports</Link>
        <Link to="/category/technology">Technology</Link>
      </nav>
    </header>
  );
}

export default Header;
